import React from 'react';
import background from '../background.jpg'

function HomepageImage() {
  return (
    <img src={background} style={{backgroundPosition: 'center',backgroundSize: 'cover',
         backgroundRepeat: 'no-repeat',}}alt='Image of Iceland' />
  );
}

export default HomepageImage;
